import React from "react";
import MovieBox from "./MovieBox"

const tempData = [
  {id: 1, name: 'Titanic', img: './public/images/movies/titanic.jpg' },
  {id: 2, name: 'Scary Movie', img: 'social-cinema/public/images/movies/scary.jpg' },
  {id: 3, name: 'Jaws', img: 'social-cinema/public/images/movies/jaws.jpg'},
  {id: 4, name: 'Baby Driver', img: '../social-cinema/public/images/movies/baby.jpeg' },
]

export default function List(props) {
  let boxes = [];
  for (let x = 0; x < 10; x++) {
    if (tempData.length >= x) {

      boxes.push(<MovieBox name={tempData['name']} />)
    } else {
    boxes.push(<MovieBox name='hi'/>)
    }
  } 

  return (
    <article className="list">{boxes}</article>
  )
}
